def __new__(cls, data=None, dtype=None, copy=False, name=None, fastpath=None, tupleize_cols=True, **kwargs) -> 'Index':
    from .range import RangeIndex
    from pandas import PeriodIndex, DatetimeIndex, TimedeltaIndex
    from .numeric import Float64Index, Int64Index, UInt64Index
    from .interval import IntervalIndex
    from .category import CategoricalIndex
    if name is None and hasattr(data, 'name'):
        name = data.name
    if fastpath is not None:
        warnings.warn("The 'fastpath' keyword is deprecated, and will be removed in a future version.", FutureWarning, stacklevel=2)
        if fastpath:
            return cls._simple_new(data, name)
    if isinstance(data, ABCPandasArray):
        data = data.to_numpy()
    if isinstance(data, RangeIndex):
        return RangeIndex(start=data, copy=copy, dtype=dtype, name=name)
    elif isinstance(data, range):
        return RangeIndex.from_range(data, dtype=dtype, name=name)
    elif is_categorical_dtype(data) or is_categorical_dtype(dtype):
        return CategoricalIndex(data, dtype=dtype, copy=copy, name=name, **kwargs)
    elif (is_interval_dtype(data) or is_interval_dtype(dtype)) and (not is_object_dtype(dtype)):
        closed = kwargs.get('closed', None)
        return IntervalIndex(data, dtype=dtype, name=name, copy=copy, closed=closed)
    elif is_datetime64_any_dtype(data) or is_datetime64_any_dtype(dtype) or 'tz' in kwargs:
        if is_dtype_equal(_o_dtype, dtype):
            result = DatetimeIndex(data, copy=False, name=name, **kwargs)
            return result.astype(object)
        else:
            return DatetimeIndex(data, copy=copy, name=name, dtype=dtype, **kwargs)
    elif is_timedelta64_dtype(data) or is_timedelta64_dtype(dtype):
        if is_dtype_equal(_o_dtype, dtype):
            result = TimedeltaIndex(data, copy=False, name=name, **kwargs)
            return result.astype(object)
        else:
            return TimedeltaIndex(data, copy=copy, name=name, dtype=dtype, **kwargs)
    elif is_period_dtype(data) and (not is_object_dtype(dtype)):
        return PeriodIndex(data, copy=copy, name=name, **kwargs)
    elif is_extension_array_dtype(data) or is_extension_array_dtype(dtype):
        data = np.asarray(data)
        if not (dtype is None or is_object_dtype(dtype)):
            ea_cls = dtype.construct_array_type()
            data = ea_cls._from_sequence(data, dtype=dtype, copy=False)
        data = data.astype(object)
        return Index(data, dtype=object, copy=copy, name=name, **kwargs)
    elif isinstance(data, (np.ndarray, Index, ABCSeries)):
        if dtype is not None:
            if is_integer_dtype(dtype):
                inferred = lib.infer_dtype(data, skipna=False)
                if inferred == 'integer':
                    data = maybe_cast_to_integer_array(data, dtype, copy=copy)
                elif inferred in ['floating', 'mixed-integer-float']:
                    if isna(data).any():
                        raise ValueError('cannot convert float NaN to integer')
                    if inferred == 'mixed-integer-float':
                        data = maybe_cast_to_integer_array(data, dtype)
                    try:
                        return cls._try_convert_to_int_index(data, copy, name, dtype)
                    except ValueError:
                        pass
                    return Float64Index(data, copy=copy, dtype=dtype, name=name)
                elif inferred == 'string':
                    pass
                else:
                    data = data.astype(dtype)
            elif is_float_dtype(dtype):
                inferred = lib.infer_dtype(data, skipna=False)
                if inferred == 'string':
                    pass
                else:
                    data = data.astype(dtype)
            else:
                data = np.array(data, dtype=dtype, copy=copy)
        if is_signed_integer_dtype(data.dtype):
            return Int64Index(data, copy=copy, dtype=dtype, name=name)
        elif is_unsigned_integer_dtype(data.dtype):
            return UInt64Index(data, copy=copy, dtype=dtype, name=name)
        elif is_float_dtype(data.dtype):
            return Float64Index(data, copy=copy, dtype=dtype, name=name)
        elif issubclass(data.dtype.type, np.bool) or is_bool_dtype(data):
            subarr = data.astype('object')
        else:
            subarr = com.asarray_tuplesafe(data, dtype=object)
        if copy:
            subarr = subarr.copy()
        if dtype is None:
            inferred = lib.infer_dtype(subarr, skipna=False)
            if inferred == 'integer':
                try:
                    return cls._try_convert_to_int_index(subarr, copy, name, dtype)
                except ValueError:
                    pass
                return Index(subarr, copy=copy, dtype=object, name=name)
            elif inferred in ['floating', 'mixed-integer-float', 'integer-na']:
                return Float64Index(subarr, copy=copy, name=name)
            elif inferred == 'interval':
                try:
                    return IntervalIndex(subarr, name=name, copy=copy)
                except ValueError:
                    pass
            elif inferred == 'boolean':
                pass
            elif inferred != 'string':
                if inferred.startswith('datetime'):
                    try:
                        return DatetimeIndex(subarr, copy=copy, name=name, **kwargs)
                    except (ValueError, OutOfBoundsDatetime):
                        pass
                elif inferred.startswith('timedelta'):
                    return TimedeltaIndex(subarr, copy=copy, name=name, **kwargs)
                elif inferred == 'period':
                    try:
                        return PeriodIndex(subarr, name=name, **kwargs)
                    except IncompatibleFrequency:
                        pass
        if kwargs:
            raise TypeError(f'Unexpected keyword arguments {set(kwargs)!r}')
        return cls._simple_new(subarr, name, **kwargs)
    elif hasattr(data, '__array__'):
        return Index(np.asarray(data), dtype=dtype, copy=copy, name=name, **kwargs)
    elif data is None or is_scalar(data):
        raise cls._scalar_data_error(data)
    else:
        if tupleize_cols and is_list_like(data):
            if is_iterator(data):
                data = list(data)
            if data and all((isinstance(e, tuple) for e in data)):
                from .multi import MultiIndex
                return MultiIndex.from_tuples(data, names=name or kwargs.get('names'))
        subarr = com.asarray_tuplesafe(data, dtype=object)
        return Index(subarr, dtype=dtype, copy=copy, name=name, **kwargs)

@cache_readonly
def _constructor(self):
    return type(self)

def _get_attributes_dict(self):
    """
    Return an attributes dict for my class.
    """
    return {k: getattr(self, k, None) for k in self._attributes}

@Appender(_index_shared_docs['_shallow_copy'])
def _shallow_copy(self, values=None, **kwargs):
    if values is None:
        values = self.values
    attributes = self._get_attributes_dict()
    attributes.update(kwargs)
    if not len(values) and 'dtype' not in kwargs:
        attributes['dtype'] = self.dtype
    values = getattr(values, '_values', values)
    if isinstance(values, ABCDatetimeArray):
        values = values.asi8
    return self._simple_new(values, **attributes)

def _shallow_copy_with_infer(self, values, **kwargs):
    """
    Create a new Index inferring the class with passed value, don't copy
    the data, use the same object attributes with passed in attributes
    taking precedence.

    *this is an internal non-public method*

    Parameters
    ----------
    values : the values to create the new Index, optional
    kwargs : updates the default attributes for this Index
    """
    attributes = self._get_attributes_dict()
    attributes.update(kwargs)
    attributes['copy'] = False
    if not len(values) and 'dtype' not in kwargs:
        attributes['dtype'] = self.dtype
    if self._infer_as_myclass:
        try:
            return self._constructor(values, **attributes)
        except (TypeError, ValueError):
            pass
    return Index(values, **attributes)

@cache_readonly
def _engine(self):
    _ndarray_values = self._ndarray_values
    return self._engine_type(lambda: _ndarray_values, len(self))

def __len__(self) -> int:
    """
    Return the length of the Index.
    """
    return len(self._data)

def __array__(self, dtype=None):
    """
    The array interface, return my values.
    """
    return np.asarray(self._data, dtype=dtype)

def __array_wrap__(self, result, context=None):
    """
    Gets called after a ufunc.
    """
    result = lib.item_from_zerodim(result)
    if is_bool_dtype(result) or lib.is_scalar(result):
        return result
    attrs = self._get_attributes_dict()
    return Index(result, **attrs)

@cache_readonly
def dtype(self):
    """
    Return the dtype object of the underlying data.
    """
    return self._data.dtype

@property
def dtype_str(self):
    """
    Return the dtype str of the underlying data.

    .. deprecated:: 0.25.0
    """
    warnings.warn('`dtype_str` has been deprecated. Call `str` on the dtype attribute instead.', FutureWarning, stacklevel=2)
    return str(self.dtype)

def view(self, cls=None):
    if cls is not None and (not hasattr(cls, '_typ')):
        result = self._data.view(cls)
    else:
        result = self._shallow_copy()
    if isinstance(result, Index):
        result._id = self._id
    return result

@Appender(_index_shared_docs['astype'])
def astype(self, dtype, copy=True):
    if is_dtype_equal(self.dtype, dtype):
        return self.copy() if copy else self
    elif is_categorical_dtype(dtype):
        from .category import CategoricalIndex
        return CategoricalIndex(self.values, name=self.name, dtype=dtype, copy=copy)
    elif is_datetime64tz_dtype(dtype):
        from pandas import DatetimeIndex
        tz = pandas_dtype(dtype).tz
        return DatetimeIndex(np.asarray(self)).tz_localize('UTC').tz_convert(tz)
    elif is_extension_array_dtype(dtype):
        return Index(np.asarray(self), dtype=dtype, copy=copy)
    try:
        if is_datetime64tz_dtype(dtype):
            from pandas import DatetimeIndex
            return DatetimeIndex(self.values, name=self.name, dtype=dtype, copy=copy)
        return Index(self.values.astype(dtype, copy=copy), name=self.name, dtype=dtype)
    except (TypeError, ValueError):
        msg = 'Cannot cast {name} to dtype {dtype}'
        raise TypeError(msg.format(name=type(self).__name__, dtype=dtype))

@Appender(_index_shared_docs['take'] % _index_doc_kwargs)
def take(self, indices, axis=0, allow_fill=True, fill_value=None, **kwargs):
    if kwargs:
        nv.validate_take(tuple(), kwargs)
    indices = ensure_platform_int(indices)
    if self._can_hold_na:
        taken = self._assert_take_fillable(self.values, indices, allow_fill=allow_fill, fill_value=fill_value, na_value=self._na_value)
    else:
        if allow_fill and fill_value is not None:
            msg = 'Unable to fill values because {0} cannot contain NA'
            raise ValueError(msg.format(self.__class__.__name__))
        taken = self.values.take(indices)
    return self._shallow_copy(taken)

def _assert_take_fillable(self, values, indices, allow_fill=True, fill_value=None, na_value=np.nan):
    """
    Internal method to handle NA filling of take.
    """
    indices = ensure_platform_int(indices)
    if allow_fill and fill_value is not None:
        if (indices < -1).any():
            msg = 'When allow_fill=True and fill_value is not None, all indices must be >= -1'
            raise ValueError(msg)
        taken = algos.take(values, indices, allow_fill=allow_fill, fill_value=na_value)
    else:
        taken = values.take(indices)
    return taken

@Appender(_index_shared_docs['repeat'] % _index_doc_kwargs)
def repeat(self, repeats, axis=None):
    repeats = ensure_platform_int(repeats)
    nv.validate_repeat(tuple(), dict(axis=axis))
    return self._shallow_copy(self._values.repeat(repeats))

@Appender(_index_shared_docs['copy'])
def copy(self, name=None, deep=False, dtype=None, **kwargs):
    if deep:
        new_index = self._shallow_copy(self._data.copy())
    else:
        new_index = self._shallow_copy()
    names = kwargs.get('names')
    names = self._validate_names(name=name, names=names, deep=deep)
    new_index = new_index.set_names(names)
    if dtype:
        new_index = new_index.astype(dtype)
    return new_index

