def __setstate__(self, state):
    """
    Necessary for making this object picklable.
    """
    if isinstance(state, dict):
        self._data = state.pop('data')
        for k, v in state.items():
            setattr(self, k, v)
    elif isinstance(state, tuple):
        if len(state) == 2:
            nd_state, own_state = state
